  false,\n\t\"url\": null,\n\t\"notes\": \"This data set provides access to information
  gathered on annual breeding bird surveys in California using a map layer developed
  by the Department. This data layer links to the breeding birds survey information
  that has been gathered from observers, compiled, and made available over the internet
  by the Migratory Bird Research Program, Patuxent Wildlife Research Center of the
  U.S. Geological Survey. The Breeding Bird Survey web site can be reached directly
  at http://www.pwrc.usgs.gov/bbs/ . A more complete description of the breeding bird
  survey program and the data than that given here is available at http://www.mbr-pwrc.usgs.gov/bbs/genintro.html
  and http://www.pwrc.usgs.gov/bbs/about/ . TIME PERIOD COVERED. The span of breeding
  bird survey records in the complete database is from 1963 through 2003. Not all
  of the survey routes were initiated in 1963 and some are not active. So, many will
  not have survey results for the complete period during which the surveys have been
  conducted. NUMBER OF RECORDS. The shapefile containing the survey routes was produced
  in 1999 and displays and provides links to 248 routes. The current (Aug. 2004) USGS
  site has information on 255 routes. The routes missing from our map, and their links,
  are: (087) Needles -------- http://www.mbr-pwrc.usgs.gov/cgi-bin/rtena23.pl?14087
  (152) Cordova -------- http://www.mbr-pwrc.usgs.gov/cgi-bin/rtena23.pl?14152 (225)
  Tres Pinos 2 ---- http://www.mbr-pwrc.usgs.gov/cgi-bin/rtena23.pl?14225 (320) Collegeville
  2 ---- http://www.mbr-pwrc.usgs.gov/cgi-bin/rtena23.pl?14320 (429) Cecilville --------
  http://www.mbr-pwrc.usgs.gov/cgi-bin/rtena23.pl?14429 (536) Squaw Valley --- http://www.mbr-pwrc.usgs.gov/cgi-bin/rtena23.pl?14536
  (953) South Fork Mtn - http://www.mbr-pwrc.usgs.gov/cgi-bin/rtena23.pl?14953 GEOGRAPHIC
  EXTENT OF THE RECORDS. The Breeding Bird Survey routes are found throughout the
  State and are distributed across all 12 of the physiographic types that the Survey
  identifies in California. WHAT EACH RECORD REPRESENTS. For each survey route information
  is provided on the species seen on that route, giving the relative abundance of
  each (number of that species of bird per number of times the route has been surveyed),
  the trend estimate on that route for each species, and the regional (state) trend
  for that species.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
